import React from 'react';

class App extends React.Component {
    state = {language: 'english'};

    render (){
        return (
            <div className="ui container">
                <div>
                    Select Language:
                    <i className="flag us" />
                    <i className="flag nl" />
                </div>
            </div>
        );
    };
};

export default App;
